  false,\n\t\"url\": null,\n\t\"notes\": \"BPI Structures are derived from two scales
  of a focal mean analysis on bathymetry and slope. The grid is based on gridded (5
  m cell size) multibeam bathymetry, collected aboard R/V AHI merged with seafloor
  depths derived from multispectral IKONOS satellite imagery. BPI Structures was created
  using the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/). Cell
  values represent one of 12 classes in an index of seafloor terrains. This data set
  is for Rose Atoll, American Samoa.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
